import React, { Component } from 'react';

class Counter extends Component{
    render() {
        return (
            <div>
                <h1>Contador</h1>
                <h1>0</h1>
                <div>
                    <button>-</button>
                    <button>+</button>
                </div>
            </div>
        );
    }

}

export default Counter;
